This giveaway would be absolutely amazing to win. I have followed your channel for as long as I've been watching YouTube videos and you have truly inspired me to be unapologetically creative with my makeup. Going out and trying a bunch of new products has never really been an option for me since I am a full-time student. I would love to win and experience so many of these products and treat those around me as well. I appreciate your generosity and wish you the merriest of holidays and the happiest of New Years! 
xoxo Kiley
